import React from "react"
import "./App.css"
import HomePage from "./pages/homepage.component"
import { Switch, Route } from "react-router-dom"

const WesternPage = () => (
  <div>
    <h1>Western Guitars</h1>
  </div>
)

function App() {
  return (
    <div>
      <Switch>
        <Route exact path="/" component={HomePage} />
        <Route path="/western-gitarren" component={WesternPage} />
      </Switch>
    </div>
  )
}

export default App
